import React, { useState } from 'react'
import '../style.css'

const PasswordInput = ({value,onChange,label,name,placeholder}) => {

    const [isPasswordVisible, setIsPasswordVisible] = useState(false)

    return (
        <div className="eye-container">
            <label className="input-label" htmlFor="password">{label ? label : 'Password'}</label>
            <input 
                name={`${name ? name : 'password'}`} 
                value={value} 
                onChange={onChange}
                className="input-box mb-3"
                type={`${isPasswordVisible ? 'text' : "password" }`}
                placeholder={`${placeholder ? placeholder: 'Enter Your Password'}`}/>
                {
                    isPasswordVisible ?
                        <svg className="w-6 h-6 eye" onClick={() => setIsPasswordVisible(!isPasswordVisible)} fill="none" stroke="currentColor" viewBox="0 0 24 24" 
                            xmlns="http://www.w3.org/2000/svg">
                            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" 
                                d="M15 12a3 3 0 11-6 0 3 3 0 016 0z"></path>
                                <path strokeLinecap="round" strokeLinejoin="round" 
                                        strokeWidth="2" d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z">
                                </path></svg>
                    :
                    <svg className="w-6 h-6 eye" onClick={() => setIsPasswordVisible(!isPasswordVisible)} fill="none" stroke="currentColor" viewBox="0 0 24 24" 
                         xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" 
                         strokeWidth="2" d="M13.875 18.825A10.05 10.05 0 0112 19c-4.478 0-8.268-2.943-9.543-7a9.97 9.97 0 011.563-3.029m5.858.908a3 3 0 114.243 4.243M9.878 9.878l4.242 4.242M9.88 9.88l-3.29-3.29m7.532 7.532l3.29 3.29M3 3l3.59 3.59m0 0A9.953 9.953 0 0112 5c4.478 0 8.268 2.943 9.543 7a10.025 10.025 0 01-4.132 5.411m0 0L21 21"></path></svg>

                }
        </div>
    )
}

export default PasswordInput
